import React from 'react';
import Button from '../components/ui/Button';

export default function Home() {
  return (
    <div className="p-6 space-y-12">
      {/* Hero Section */}
      <section className="text-center py-12 bg-green-50 rounded-xl shadow-md">
        <h2 className="text-4xl font-bold mb-4">Natural Roots. Nordic Quality.</h2>
        <p className="text-lg max-w-2xl mx-auto mb-6">
          TropiNord sources and distributes organic oils, eco soaps, and natural wellness products â€”
          supporting small producers and delivering ethical, sustainable goods across Sweden and Europe.
        </p>
        <div className="flex justify-center space-x-4">
          <Button>Explore Our Products</Button>
          <Button>Contact Us</Button>
        </div>
      </section>

      {/* Mission Statement */}
      <section className="max-w-4xl mx-auto">
        <h3 className="text-2xl font-semibold mb-3">Our Mission</h3>
        <p className="text-gray-700 text-lg">
          We believe in transparency, ethical sourcing, and supporting community-led growth.
          From African black soap to eco-imports and youth wellness programs, we blend global heritage
          with Nordic quality and values.
        </p>
      </section>
    </div>
  );
}
